import React from "react";
import ReactDOM from "react-dom";
import windowDimensions from "./windowDimensions"

const white = "/assets/logoWhite.png";
const gold = "/assets/logoGold.png";

const HoverImage = props => {
    function over(e) {
        e.currentTarget.src = props.hoverImage;
    }
    function out(e) {
        e.currentTarget.src = props.normalImage;
    }
    return <img src={props.normalImage} onMouseOver={over} onMouseOut={out} alt="M" className="headerImage" height={props.height} width={props.width} />
};

function HeaderHover() {
    const {winHeight, winWidth } = useWindowDimensions();

    let actualWidth = 1456;
    let actualHeight = 482;
    let ratio = windowSize/actualWidth;
    let newHeight = actualHeight * ratio;

    return (
            <HoverImage width={window.Width} height={newHeight} normalImage={gold} hoverImage={white} />
    )
}

const rootElement = document.getElementById("root");
ReactDOM.render(<HeaderHover />, rootElement); 
export default HeaderHover;
